import React, { useState, useEffect } from 'react'
import { ContainerContent, Header, TitlePokemon, IdPokemon, Img, ContainerPokemon, ContainerTexts, ContainerImage, ContainerGrid, ContainerDatas, TextTitleDatas, SubContainerDatas, StatusBox, TextSubDatas, BoxProgresos, BoxBorder } from './styles';

import GlobalStyle from '../styles/global';
import Sidebar from '../components/Sidebar';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useParams
} from "react-router-dom";

interface Pokemon {
  name: string;
  game_index: string;
  sprite: string;

  stats: Array<{ base_stat: string }>;

  weight: number;
  height: number;
}

function Home() {

  const [pokemon, setPokemon] = useState<Pokemon>();

  const { url } = useParams();

  useEffect(() => {
    async function fetchData() {
      const res = await fetch(url === undefined ? `https://pokeapi.co/api/v2/pokemon/1` : `https://pokeapi.co/api/v2/pokemon/${url}`);
      const data = await res.json();
      setPokemon({
        name: data.name,
        game_index: data.id,
        sprite: data.sprites.other?.["official-artwork"].front_default,
        stats: data.stats.map((stat: any) => stat.base_stat),
        weight: data.weight,
        height: data.height
      });
    }
    fetchData();
  }, [url]);

  
  return (
    <div className='App'>
      <GlobalStyle />

      <Sidebar/>

      <ContainerContent>
        <Header></Header>

        {pokemon ? (
          <ContainerPokemon>
            <ContainerTexts>
              <IdPokemon>#{pokemon.game_index}</IdPokemon>
              <TitlePokemon>{pokemon.name}</TitlePokemon>
            </ContainerTexts>

            <ContainerGrid>
              <ContainerImage>
                <Img src={pokemon.sprite} alt={pokemon.name} />
              </ContainerImage>

              <ContainerDatas>
                <TextTitleDatas>Status</TextTitleDatas>

                <SubContainerDatas>
                  <StatusBox>
                    <TextSubDatas>HP: {pokemon.stats[0].toString()}</TextSubDatas>
                    <BoxBorder>
                      <BoxProgresos style={{ width: pokemon.stats[0].toString() + '%' }} />
                    </BoxBorder>
                  </StatusBox>
                  <StatusBox>
                    <TextSubDatas>Attack: {pokemon.stats[1].toString()}</TextSubDatas>
                    <BoxBorder>
                      <BoxProgresos style={{ width: pokemon.stats[1].toString() + '%' }} />
                    </BoxBorder>
                  </StatusBox>
                  <StatusBox>
                    <TextSubDatas>Defense: {pokemon.stats[2].toString()}</TextSubDatas>
                    <BoxBorder>
                      <BoxProgresos style={{ width: pokemon.stats[2].toString() + '%' }} />
                    </BoxBorder>
                  </StatusBox>
                  <StatusBox>
                    <TextSubDatas>SP. Attack: {pokemon.stats[3].toString()}</TextSubDatas>
                    <BoxBorder>
                      <BoxProgresos style={{ width: pokemon.stats[3].toString() + '%' }} />
                    </BoxBorder>
                  </StatusBox>
                  <StatusBox>
                    <TextSubDatas>SP. Defense: {pokemon.stats[4].toString()}</TextSubDatas>
                    <BoxBorder>
                      <BoxProgresos style={{ width: pokemon.stats[4].toString() + '%' }} />
                    </BoxBorder>
                  </StatusBox>
                  <StatusBox>
                    <TextSubDatas>Speed: {pokemon.stats[5].toString()}</TextSubDatas>
                    <BoxBorder>
                      <BoxProgresos style={{ width: pokemon.stats[5].toString() + '%' }} />
                    </BoxBorder>
                  </StatusBox>
                </SubContainerDatas>
              </ContainerDatas>

              <ContainerDatas>
                <TextTitleDatas>Dados da Pokédex</TextTitleDatas>
                <StatusBox>
                  <TextSubDatas>Altura: {Math.floor(pokemon.height * 10) / 100}m</TextSubDatas>
                  <TextSubDatas>Peso: {Math.floor(pokemon.weight * 10) / 100}kg</TextSubDatas>
                </StatusBox>
              </ContainerDatas>
            </ContainerGrid>

          </ContainerPokemon>
        ) : (
          <ContainerPokemon>
            <ContainerTexts>
              <IdPokemon>Carregando...</IdPokemon>
              <TitlePokemon>Carregando...</TitlePokemon>
            </ContainerTexts>

            <ContainerImage>
            </ContainerImage>
          </ContainerPokemon>
        )}

      </ContainerContent >
    </div>
  );
}

export default Home;
